webpackJsonp([66139734551796],{644:function(e,a){e.exports={data:{markdownRemark:{html:'<h3>Submission Requirements: Two-Factor Authentication</h3>\n<p>Programs can now <a href="/programs/submission.html">require</a> hackers to have two-factor authentication enabled in order to submit new reports to their program.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/submission-2-b502135c213cb9b300260315a5de2aea-a0390.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 12.112676056338028%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAACCAYAAABYBvyLAAAACXBIWXMAABcSAAAXEgFnn9JSAAAAUklEQVQI13XMywmAMBAE0PTfjVWkBDvwpGQ3B/eXMKIQUdDDg2EGJpkZROSmqp/5T7hh5cCyBdwd6TwkIjDzpdb68tyG0RVi9NiR54YpB3pvOAAKwZnwhrSySQAAAABJRU5ErkJggg==\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="submissions"\n        title=""\n        src="/static/submission-2-b502135c213cb9b300260315a5de2aea-2f183.png"\n        srcset="/static/submission-2-b502135c213cb9b300260315a5de2aea-67829.png 125w,\n/static/submission-2-b502135c213cb9b300260315a5de2aea-5c59f.png 250w,\n/static/submission-2-b502135c213cb9b300260315a5de2aea-2f183.png 500w,\n/static/submission-2-b502135c213cb9b300260315a5de2aea-a0390.png 710w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>We\'ve also renamed the <b>Signal Requirements</b> page under <b>Settings > Program > Hacker Management</b> to now be called <b>Submission</b>.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/submission-c5955d47fc9b2d6d8f9ae61467f84242-ed411.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 374px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50.80213903743316%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="submissions"\n        title=""\n        src="/static/submission-c5955d47fc9b2d6d8f9ae61467f84242-ed411.png"\n        srcset="/static/submission-c5955d47fc9b2d6d8f9ae61467f84242-1b678.png 125w,\n/static/submission-c5955d47fc9b2d6d8f9ae61467f84242-7c4d8.png 250w,\n/static/submission-c5955d47fc9b2d6d8f9ae61467f84242-ed411.png 374w"\n        sizes="(max-width: 374px) 100vw, 374px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Embedded Submission Form</h3>\n<p>Programs can now embed the HackerOne report submission form onto their own website. This enables hackers to submit reports without having to create an account on HackerOne. Learn more <a href="/programs/embedded-submissions-form.html">here</a>.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/embedded-submissions-88de925f0e3d581fa790e44e393ba46a-d205c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 51.04477611940299%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="embedded-submissions"\n        title=""\n        src="/static/embedded-submissions-88de925f0e3d581fa790e44e393ba46a-2f183.png"\n        srcset="/static/embedded-submissions-88de925f0e3d581fa790e44e393ba46a-67829.png 125w,\n/static/embedded-submissions-88de925f0e3d581fa790e44e393ba46a-5c59f.png 250w,\n/static/embedded-submissions-88de925f0e3d581fa790e44e393ba46a-2f183.png 500w,\n/static/embedded-submissions-88de925f0e3d581fa790e44e393ba46a-c93e8.png 750w,\n/static/embedded-submissions-88de925f0e3d581fa790e44e393ba46a-4e628.png 1000w,\n/static/embedded-submissions-88de925f0e3d581fa790e44e393ba46a-d205c.png 1340w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Sessions</h3>\n<p>Anyone can now review and manage their active HackerOne sessions on all of the devices they\'re signed in to on the new <b><a href="/hackers/sessions.html">Sessions</a></b> page.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sessions-1-8efb365b8b62a5f4ab20806a39bb3265-7888b.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 59.753593429158116%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="sessions"\n        title=""\n        src="/static/sessions-1-8efb365b8b62a5f4ab20806a39bb3265-2f183.png"\n        srcset="/static/sessions-1-8efb365b8b62a5f4ab20806a39bb3265-67829.png 125w,\n/static/sessions-1-8efb365b8b62a5f4ab20806a39bb3265-5c59f.png 250w,\n/static/sessions-1-8efb365b8b62a5f4ab20806a39bb3265-2f183.png 500w,\n/static/sessions-1-8efb365b8b62a5f4ab20806a39bb3265-c93e8.png 750w,\n/static/sessions-1-8efb365b8b62a5f4ab20806a39bb3265-7888b.png 974w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Credential Management (beta)</h3>\n<p>We\'ve enabled the beta <a href="/programs/credential-management.html">Credential Management</a> feature so that select programs can share credentials with hackers through the HackerOne UI. This enables hackers to quickly retrieve the credentials needed to find vulnerabilities.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/credential-management-2-af285285232ad5aab00e3c85cd9b0143-bebc0.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 61.1328125%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="credential management"\n        title=""\n        src="/static/credential-management-2-af285285232ad5aab00e3c85cd9b0143-2f183.png"\n        srcset="/static/credential-management-2-af285285232ad5aab00e3c85cd9b0143-67829.png 125w,\n/static/credential-management-2-af285285232ad5aab00e3c85cd9b0143-5c59f.png 250w,\n/static/credential-management-2-af285285232ad5aab00e3c85cd9b0143-2f183.png 500w,\n/static/credential-management-2-af285285232ad5aab00e3c85cd9b0143-bebc0.png 512w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Bug Fixes</h3>\n<ul>\n<li>Your active HackerOne sessions will no longer end prematurely. Sorry for that annoyance!</li>\n<li>We\'ve also fixed the "Remember me" bug. Your login credentials will actually be remembered for 2 week periods so that you don\'t have to repeatedly log in in order to access your account.  </li>\n</ul>',frontmatter:{path:"/changelog/2018/september",title:"September 2018"}}},pathContext:{}}}});
